import Link from 'next/link';

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Latest Posts</a>
    </Link>
    <Link href="/posts/new">
      <a style={linkStyle}>Create new Post</a>
    </Link>
  </div>
);

export default Header;
